const Cat = (props) => {
  const[name, setName] = useState(null);
  const[age, setAge] = useState(null);
  return(
    <View style = {styles.container}>
      {/* <Text>Hello,I go by name {props.name}, I am {myAge} years old. {myAge > 18 ? 'I am an adult' : 'I am yet to be an adult'}</Text> */}
      <Text>Enter Name</Text>
      <TextInput placeholder = 'Enter your name'
      onChangeText={setName}/>
      <Text>Enter Age</Text>
      <TextInput placeholder = 'Enter age'
      onChangeText = {setAge}/>
      {/* <Button onPress={() => setMyAge(myAge+1)} title='Increase Age'/> */}
      <Button onPress={() => alert(name + age)} title='OK'/>
    </View>
  );
}
const App = () => {
  return(
    <View style = {styles.container}>
      <Cat name = 'Agartha'/>
    </View>
  );
}

export default App;

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
});
